#!/usr/bin/env node
var argv = process.argv;
console.log(argv);
var cmd = process.argv.pop();
var cmdList = {
	'init': './lib/init.js',
	'update': './lib/update.js',
	'push': './lib/push.js'
};
if (typeof(cmdList[cmd]) !== 'undefined') {
	require(__dirname + '/' + cmdList[cmd])();
} else {
	console.log('xes');
}

